Описание ивента: 
Старейшины устраивают испытание. Именно оно определит прирожденного победителя, который способен одержать победу и остаться на коне ни смотря ни на что. Вам предстоит пройти одну из самых опаснейших трасс Азерота, где каждый соперник смертельный враг, а любой неосторожный шаг может стать последним! 
Только ловкость, смекалка и немного удачи помогут вам преодолеть все сложности в этом испытании. Многим будет не под силу и половина пути, но те счастливцы, кто дойдут до победного конца, получат по-настоящему ценные награды. 
Пришло время показать всему миру чего вы стоите! 

Особенности ивента: 
* В каждом забеге участвуют 4(минимум) участников. 
* В следующий круг проходит только победитель. 
* В финальной гонке примут участие победители забегов первого круга. 
* Если вы будете каким-либо образом выброшены за пределы трассы - гонка для вас окончена. 

Запрещено! 
- ПВП за пределами трассы. 
- Использовать маунтов. 
- Передвигаться в состоянии незаметности. 
- Находится в группе с кем-либо из участников. 
- Использовать квестовые предметы, а так же созданные профессиями (например Нитроускорители). 
- Использовать любые предметы, дающие ускорение. 

Разрешено! 
- ПВП в пределах построенной трассы между участниками. 
- Использовать способности своего персонажа. 
- Использовать зелья восстановления здоровья/маны и бинты. 
*/

